import { useState } from "react";
import Footer from "./Footer/Footer";
import Header from "./Header/Header";
import './index.css'
import Items from "./Items/Items";

export default function App() {

const [items, setItems] = useState([
    {
        id: 1,
        img: '',
        title: 'chair',
        price: 49.99,
        descr: 'lorem',
        category: 'chair',
        
    },

    {
        id: 3,
        img: '',
        title: 'chair',
        price: 49.99,
        descr: 'lorem',
        category: 'chair'
    },

    { id: 2,
        img: '',
        title: 'chair',
        price: 49.99,
        descr: 'lorem',
        category: 'chair'}
])

return (
    <div className="container">
        <Header/>
        <Items items={items}/>
        <Footer/>
    </div>
)

}
